import ReactDOM from 'react-dom'
import React from 'react';
import { Canvas } from '@react-three/fiber'

function App() {
  return (
    <div id="canvas-container">
      <Canvas />
      <mesh>
        <boxGeometry />
        <meshStandardMaterial />
      </mesh>
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById('root'))

export default App;
